import '../Assets/CSS/inicio.css';

const Inicio = () => {

    return (
        <div>
            <h1>Gym-UTMita</h1>
            <p>"Nuestros entrenadores están aquí para apoyarte en tus metas físicas y de bienestar mientras te embarcas en tu viaje universitario. Ya sea que busques mejorar tu rendimiento atlético, mantenerte en forma o simplemente encontrar un equilibrio saludable entre tus estudios y tu bienestar, nuestro equipo está comprometido a ayudarte a alcanzar tus objetivos en el gimnasio de la universidad."</p>
        </div>
    );
};

export default Inicio;
